import { Outlet, useNavigate } from 'react-router-dom';
import React, { useEffect } from 'react';

const RouteGuard = ({ isAuthorized }) => {
    const navigate = useNavigate();
    if (!isAuthorized) {
      navigate('/login');
    }
    return isAuthorized ? <Outlet /> : null;
  };

export default RouteGuard;
